const GoogleRecaptcha = () => (
    <div className="recaptcha__element">Recaptcha goes here!</div>
)

const loadRecaptcha = () => {
    console.log('loadRecaptcha');
}

const getRecaptcha = () => {
    console.log('getRecaptcha');
}

const initRecaptcha = () => {
    console.log('initRecaptcha');
    const url = 'https://www.google.com/recaptcha/api.js';
    const queryString = '?onload=loadRecaptcha&render=explicit';
    const script = window.document.createElement('script');
    script.type = 'text/javascript';
    script.src = url + queryString;
    script.async = true;
    script.defer = true;
}

initRecaptcha();

export default GoogleRecaptcha
